import { HttpClient, HttpResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { PerscriptionMedicale } from 'src/app/models/PerscriptionMedicale';

@Injectable({
  providedIn: 'root'
})
export class PrescriptionService {

  private apiUrl = 'https://localhost:7129/api/PerscriptionMedicales';

  constructor(private http: HttpClient) { }
  add(PerscriptionMedicale: PerscriptionMedicale): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', PerscriptionMedicale);

    return this.http.post<any>(`${this.apiUrl}/add`, PerscriptionMedicale, { observe: 'response' });
  }
}
